.baby-box {
	width: 300px;
	height: 600px;
	.baby-list {
		width: 100%;
		.baby-titel{
			width: 100%;
			text-align: center;
			font-size: 14px;
			color: rgba(0,0,0,.4);
			padding: 15px 0;
		}
		li {
			width: 95%;
			margin: 0 auto;
			display: flex;
			padding: 5px 0;
			.list-img {
				width: 45px;
				height: 45px;
				border-radius: 50%;
				img {
					width: 100%;
					height: 100%;
				}
			}
			.list-name{
				padding-left: 10px;
				display: flex;
				align-items: center;
				p{
					font-size: 14px;
					color: rgba(0,0,0,.7);
				}
			}
		}
	}
}
.baby-btn{
	width: 100%;
	text-align: center;
	position: fixed;
	bottom: 0;
	padding: 10px 0;
	p{
		width: 100%;
		font-size: 16px;
		color: #0088CC;
	}
}
